import React from 'react'
import ReactDOM from 'react-dom'
import './index.css'

// heading {
//   color : #fa9191;
//   text-align: center;
//   text-transform: capitalize;
//   font-weight: bold;
//   text-shadow: 0px 2px 4px blueviolet;
//   margin : 50px 0;
//   font-family: 'Josefin Sans', sans-serif;
// }

const heading = {
  color : '#fa9191',
  textTransform: 'capitalize',
  textAlign : 'center',
  fontWeight: 'bold',
  textShadow: '0px 2px 4px blueviolet',
  margin : '50px 0',
  fontFamily: "'Josefin Sans', sans-serif"
}

const name = 'Abdur';
const img1 = 'https://picsum.photos/200/300';
const img2 = 'https://picsum.photos/250/300';
const img3 = 'https://picsum.photos/220/300';
const links = 'https://www.thapatechnical.com/';

ReactDOM.render(
<>
  <h1 style={heading}>My Name is {name}</h1>
  <div className="img_div">
     <img src = {img1} alt="Random Image" />
     <img src = {img2} alt="Random Image" />
     <a href={links} target="_abd">
       <img src = {img3} alt="Random Image" />
     </a>
  </div>
</>,
  document.getElementById('root')
);
